public Builder nextProcedure(T procedure) {
  int size = procedures.size();
  if (size > 0) {
    procedures.get(size - 1).setNextProcedure(procedure.name());
  }
  procedure.setNextProcedure(NEXT_PROCEDURE_NONE);
  procedures.add(procedure);
  return this;
}
